import React from 'react'
import {Row, Col} from 'react-bootstrap'
import HomePlace from '../Places/HomePlace'
import HomeScreenCard from './HomeScreenCard'
import India from '../Places/India'
import { useParams } from 'react-router'

const Country = ['56745',India];





const HomeScreenCountryCard = ({match}) => {
        const Dountry = useParams()
        const bb = Country[Dountry.id]
       
        
    return (
        <>
            <Row className="home-screen-container my-3 p-3 w-100" >
                {
                   bb.map((homeplace)=>(
                        <Col>
                            <HomeScreenCard
                                homeplace={homeplace}
                            />
                        </Col>
                    ))
                }
            </Row>
        </>
    )
}

export default HomeScreenCountryCard
